import React from 'react'
import styled from 'styled-components'

const CoinRow = ({ name, symbol, quantity, image }) => {
    console.log(name)
    return (
        <div>
            <h1>{name}</h1>
            <h1>{symbol}</h1>
        </div>
    )
}

export default CoinRow

const CoinRowContainer = styled.div`
    display: flex;
    flex-direction: row;
`
